        onAllGridEditedEventMethod(data, is_resep) {
            if (this.AllGridEditedData.length > 0) {
                let current_data = 0;
                if (is_resep) {
                    current_data = this.AllGridEditedData.map((item) => { return item.id_transaksi_obat; }).indexOf(data.id_transaksi_obat);
                }
                else {
                    current_data = this.AllGridEditedData.map((item) => { return item.id_transaksi; }).indexOf(data.id_transaksi);
                }
                if (current_data > -1) {
                    this.AllGridEditedData.splice(current_data, 1);
                    this.AllGridEditedData.push(data);
                }
                else {
                    this.AllGridEditedData.push(data);
                }
            }
            ;
            if (this.AllGridEditedData.length < 1) {
                this.AllGridEditedData.push(data);
            }
            ;
            this.onGetDetailAkomodasiBillingEdited();
        }
        onCompareBillingItemForSummarize(BillingItem, AllGridEditedData) {
            let all_detail = [];
            BillingItem.forEach((item) => {
                all_detail.push(...item.detail);
            });
            AllGridEditedData.forEach((item) => {
                // ** id_transaksi
                if (item.id_transaksi) {
                    let index = all_detail.map((all) => { return all.id_transaksi; }).indexOf(item.id_transaksi);
                    all_detail[index] = item;
                }
                ;
                // ** resep
                if (item.id_transaksi_obat) {
                    let index = all_detail.map((all) => { return all.id_transaksi_obat; }).indexOf(item.id_transaksi_obat);
                    all_detail[index] = item;
                }
                ;
                // ** akomodasi
                if (item.id_transaksi_akomodasi_ekstrak) {
                    let index = all_detail.map((all) => { return all.id_transaksi_akomodasi_ekstrak; }).indexOf(item.id_transaksi_akomodasi_ekstrak);
                    all_detail[index] = item;
                }
                ;
            });
            this.BillingItemForPulang = all_detail;
            this.onSumTotalAsuransiFromAllGrid(all_detail);
            this.onSumTotalSubsidiFromAllGrid(all_detail);
            this.onSumTotalTagihanFromAllGrid(all_detail);
            this.onSumTotalIurBiayaFromAllGrid(all_detail);
        }
        onSumTotalBiayaFromAllGrid(data) {
            let all_detail = [];
            data.forEach((item) => {
                all_detail.push(...item.detail);
            });
            let total_amount = 0;
            all_detail.forEach((item) => {
                total_amount += item.total_amount;
            });
            this.total_amount.setValue(total_amount);
            this.onSumTotalAsuransiFromAllGrid(all_detail);
            this.onSumTotalSubsidiFromAllGrid(all_detail);
            this.onSumTotalTagihanFromAllGrid(all_detail);
            this.onSumTotalIurBiayaFromAllGrid(all_detail);
        }
        onSumTotalAsuransiFromAllGrid(data) {
            let comp_fee = 0;
            data.forEach((item) => {
                comp_fee += item.comp_fee;
            });
            this.claim_amount.setValue(comp_fee);
            this.asuransi_amount.setValue(comp_fee);
        }
        onSumTotalSubsidiFromAllGrid(data) {
            let subsidi = 0;
            data.forEach((item) => {
                subsidi += item.subsidi;
            });
            this.subsidi_amount.setValue(subsidi);
        }
        onSumTotalTagihanFromAllGrid(data) {
            let tagihan = 0;
            data.forEach((item) => {
                tagihan += item.tagihan;
            });
            this.charge_amount.setValue(tagihan);
            this.total_tagihan.setValue(tagihan);
        }
        onSumTotalIurBiayaFromAllGrid(data) {
            let iur_amount = 0;
            data.forEach((item) => {
                iur_amount += item.iur_biaya;
            });
            this.iur_amount.setValue(iur_amount);
        }
        onMoveAllGridTagihanIntoSubsidi() {
            let all_detail = [];
            all_detail = this.BillingItem.filter((item) => {
                item.detail.filter((detail_item) => {
                    if (detail_item.subsidi > 0) {
                        detail_item.subsidi = detail_item.tagihan + detail_item.subsidi;
                        detail_item.tagihan = 0;
                        detail_item.iur_biaya = 0;
                    }
                    else {
                        detail_item.subsidi = detail_item.tagihan;
                        detail_item.tagihan = 0;
                        detail_item.iur_biaya = 0;
                    }
                    if (detail_item.id_transaksi) {
                        this.onAllGridEditedEventMethod(detail_item);
                    }
                    ;
                    if (detail_item.id_transaksi_obat) {
                        this.onAllGridEditedEventMethod(detail_item, true);
                    }
                    ;
                    return detail_item;
                });
                return item;
            });
            this.BillingItem = [];
            this.BillingItem = all_detail;
            let akomodasi = all_detail.find(item => item.jenis_transaksi == 'AKOMODASI');
            if (akomodasi && akomodasi.detail.length > 0) {
                this.onHandlingEditDetailAkomodasiBillingUsingMoveAllToTagihan(akomodasi.detail);
            }
            this.GridDataTiket.refresh();
            this.GridDataTDMK.refresh();
            this.GridDataTDLAB.refresh();
            this.GridDataTDRAD.refresh();
            this.GridDataResep.refresh();
            this.onSumTotalBiayaFromAllGrid(this.BillingItem);
        }
        onHandlingEditDetailAkomodasiBillingUsingMoveAllToTagihan(akomodasi) {
            this.transBillingRawatInapService.DetailAkomodasiBillingEdited.next(akomodasi);
        }
        // ** TRIGGER SETELAH CLOSE MODAL AKOMODASI
        onGetDetailAkomodasiBillingEdited(args) {
            this.transBillingRawatInapService.DetailAkomodasiBillingEdited
                .subscribe((result) => {
                if (result.length > 0) {
                    result.map((result_item) => {
                        let current_akomodasi_index = this.AllGridEditedData.map((all) => { return all.id_transaksi_akomodasi_ekstrak; }).indexOf(result_item.id_transaksi_akomodasi_ekstrak);
                        if (current_akomodasi_index > -1) {
                            this.AllGridEditedData.splice(current_akomodasi_index, 1);
                            this.AllGridEditedData.push(result_item);
                        }
                        else {
                            this.AllGridEditedData.push(result_item);
                        }
                        ;
                    });
                }
            });
            this.onCompareBillingItemForSummarize(this.BillingItem, this.AllGridEditedData);
        }
